import { BrowserRouter, Routes, Route, useNavigate } from 'react-router-dom';
import Auth from './Auth'
import Homepage from './Homepage'
import { useSelector } from "react-redux";

const Routing = () => {
    const isAuth = useSelector(state => state.auth.isAuthenticated);
    return (
        <Routes>
            <ProtectiveLogin path='/' isAuth={isAuth} element={<Auth />} />
            <ProtectiveRoute path='/Homepage' isAuth={isAuth} element={<Homepage />} />
        </Routes>
    )
}

const ProtectiveRoute = ({ isAuth, component: Component, ...rest }) => {
    const navigate = useNavigate()
    return (
        <Route
            {...rest}
            render={() => isAuth ? (<Homepage />) : (navigate('/Auth')
            )
            }
        />
    )
}
const ProtectiveLogin = ({ isAuth, component: Component, ...rest }) => {
    const navigate = useNavigate()
    return (
        <Route
            {...rest}
            render={() => isAuth ? (<Homepage />) : (navigate('/Auth')
            )
            }
        />
    )
}

export default Routing
